import PhishingLesson from './components/lessons/PhishingLesson.js';
import PasswordSecurityLesson from './components/lessons/PasswordSecurityLesson.js';
import PhishingQuiz from './components/quizzes/PhishingQuiz.js';
import PasswordSecurityQuiz from './components/quizzes/PasswordSecurityQuiz.js';
import Navbar from './components/Navbar.js';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="./lessons/phishing" element={<PhishingLesson />} />
        <Route path="/quizzes/phishing" element={<PhishingQuiz />} />
        <Route path="/lessons/password-security" element={<PasswordSecurityLesson />} />
        <Route path="/quizzes/password-security" element={<PasswordSecurityQuiz />} />
      </Routes>
    </Router>
  );
}

export default App;
